C.yq=new H.aO(7,{title:"Now Microsoft\u2019s app will say why your PC isn\u2019t ready for Windows 11",source:"The Verge - All Posts",article_url:"https://www.theverge.com/2021/6/25/22550951/microsoft-pc-health-checkup-app-update-windows-11-compatibility-tool-details",image_url:"https://cdn.vox-cdn.com/thumbor/e7PX04HkowAC9WocXSu5vkDLRHk=/0x38:795x568/1310x873/cdn.vox-cdn.com/uploads/chorus_image/image/69506097/E4vsDYuVcAIg1CC.0.jpeg",date:1624823483,news_text:"Microsoft has updated its PC Health Check App to show more information about why your computer won\u2019t be able to run Windows 11, to help deal with some of the confusion that\u2019s sprung up around compatibility. If you\u2019ve already downloaded the app, it should auto-update when you go to run it again, and if you haven\u2019t downloaded it yet you can get it here. There\u2019s been a bit of confusion about what Windows 11 will and won\u2019t run on, and the previous version of the tool didn\u2019t necessarily help clear any of it up, mainly showing users a pass/fail message with no details. Now, it should at least give some clue as to why your computer isn\u2019t compatible, be it an issue with storage, secure boot compatibility, or your processor. As some have pointed out, the messages the tool gives out are still light on details in some cases: \u201cthe processor isn\u2019t supported\u201d isn\u2019t really an actionable item, as it doesn\u2019t tell you why your CPU can\u2019t run Windows 11. If you\u2019d rather upgrade a component or two in your system instead of just going out and buying a new PC, you\u2019re going to have to do some more research. You may want to wait on that, though: Microsoft still seems to be working through its messaging of what is and isn\u2019t supported, especially when it comes to CPUs. So stay tuned for a final answer before you try to brave the PC part market during a chip shortage.",how_popular:500},C.bt,t.EU)
C.yn=new H.aO(7,{title:u.e,source:"9to5Mac",article_url:"https://9to5mac.com/2021/06/27/mark-gurman-apple-exploring-future-ipad-designs-with-larger-screens/",image_url:"https://i2.wp.com/9to5mac.com/wp-content/uploads/sites/6/2021/06/iPad-Pro-2021-Review-Improvements-iPadOS-15-Concept-14.jpg",date:1624823499,news_text:"In the first instalment of Bloomberg\u2019s Power On newsletter, Mark Gurman says that Apple is currently considering future iPad designs with larger displays. The current iPad Pro maxes out at 12.9-inches diagonally. Gurman says that any new iPad screen size change is at least a \u2018couple of years down the road\u2019 and has not yet left the exploratory stages. Apple is still said to be developing a redesigned iPad chassis with a glass back for 2022, which will ship in the existing 11-inch and 12.9-inch screen sizes.",how_popular:300},C.bt,t.EU)
C.yo=new H.aO(7,{title:u.e,source:"Engadget",article_url:"https://www.engadget.com/china-zhurong-mars-rover-video-sound-173845448.html?src=rss_b2c&guccounter=1",image_url:"https://s.yimg.com/uu/api/res/1.2/lFyFuMDoV6G6rHz25q2OwA--~B/Zmk9ZmlsbDtoPTQ1MDt3PTY3NTthcHBpZD15dGFjaHlvbg--/https://s.yimg.com/os/creatr-uploaded-images/2021-06/4fb3ad60-d76b-11eb-bcbe-0bc4017fe7d0.cf.webp",date:1624823499,news_text:"The US is not the only country sending video from Mars. SpaceNews reports that China has released both video and audio from the Zhurong rover s early forays on the Red Planet. The clips cover the landing as well as the deployment and initial movement. There-s also a panorama revealing just how far Zhurong has traveled (about 774 feet in total) from its landing platform. This content is not available due to your privacy preferences. Update your settings here, then reload the page to see it. As with sounds from NASAs Perseverance, you should not expect an extraterrestrial symphony. You are mainly listening to the mechanisms and the sound of wheels on the exit ramp, with Mars thin atmosphere also skewing the results. Mars audio remains extremely rare, though, so the mission crew can not exactly be picky. There is little doubt the footage is as much about bragging rights as anything. Zhurong is part of China first truly independent mission to another planet, and the country no doubt wants to highlight its accomplishments in as much detail as possible. Between this and Perseverance, though, it is also clear that Mars exploration has changed in recent years. It is not enough to provide a handful of photos \u2014 an audiovisual experience is increasingly becoming par for the course.",how_popular:300},C.bt,t.EU)
