C.yp=new H.aO(7,{title:"Nvidia unveils real-time ray tracing Turing graphics architecture",source:"Venture Beat",article_url:"https://venturebeat.com/2018/08/13/nvidia-unveils-real-time-ray-tracing-turing-graphics-architecture/",image_url:"https://venturebeat.com/wp-content/uploads/2018/08/jensen-2.jpg?w=1200&strip=all",date:1586114075,news_text:"Nvidia said it \u201creinvented computer graphics\u201d with the unveiling of its Nvidia Turing graphics processing unit (GPU) architecture. The architecture will be the foundation for a whole family of future graphics chips that will focus on real-time ray tracing, or highly realistic, physically accurate graphics. Jensen Huang, CEO of Nvidia, said in a keynote speech at the Siggraph computer graphics event in Vancouver, Canada, that the new design is the \u201cgreatest leap since the invention of the CUDA GPU in 2006.\u201d The architecture can process graphics at six times the speed of the previous generation. Turing features new RT Cores to accelerate ray tracing and new Tensor Cores for artificial intelligence inferencing which, together for the first time, make real-time ray tracing possible, the company said.",how_popular:200},C.bt,t.EU)
C.yj=new H.aO(7,{title:"Unity Partners with PiXYZ Software to unlock CAD data for real-time development",source:"Unity Technologies Blog",article_url:"https://blogs.unity3d.com/2018/03/06/unity-partners-with-pixyz/",image_url:"https://blog-api.unity.com/sites/default/files/styles/focal_crop_ratio_3_1/public/2018/03/blog-pixyz-03b.png?imwidth=1260&h=c673cd1c&itok=OQ5cnH8O",date:1551557675,news_text:"Unity today is used across many industries beyond gaming, including aerospace, architecture, automotive, construction, gambling, transportation, manufacturing, medical, and more. The benefits of using real-time in these industries include accelerating innovation through better design collaboration, developing VR and AR training to improve training outcomes, and creating immersive experiences that can increase engagement and drive higher sales. Industry professionals are increasingly seeing the value of bringing real-time into their workflows, recognizing its potential to completely transform the way products and experiences are conceived and built. Despite the fact that forward-thinking individuals in these industries have made great strides to bring real-time into their creation processes, they have encountered persistent challenges, particularly when it comes to preparing or importing large CAD assemblies for real-time development.",how_popular:350},C.bt,t.EU)
C.ym=new H.aO(7,{title:"Samsung Galaxy Watch 4 could one-up the Apple Watch with a BIA sensor",source:"Android Central",article_url:"https://www.androidcentral.com/samsung-galaxy-watch-4-could-one-apple-watch-bia-sensor",image_url:"https://www.androidcentral.com/sites/androidcentral.com/files/styles/large_wm_brw/public/article_images/2020/08/samsung-galaxy-watch-3-1.jpg",date:1516911275,news_text:'Earlier this week, we got our first look at the design of Samsung s upcoming Galaxy Watch Active 4. Now, a new leak has revealed one of the key features of the Galaxy Watch 3 successor. According to reliable tipster Max Weinbach, the Galaxy Watch 4 will feature a BIA (Bio-Electrical Impedance Analysis) sensor to enable users to easily measure their body fat percentage in relation to the lean body mass. Since body composition is directly related to health, the Galaxy Watch 4s BIA sensor will allow you to better track your current state of health. While BIA sensors are common in smart scales, it looks like Samsung will be the first company to add one to a smartwatch. The follow-up to Samsung s best Android smartwatch was initially rumored to feature blood glucose measurement as well, but recent reports suggest Samsung has dropped the feature for some reason. It is expected to come with a circular AMOLED display featuring thinner bezels than its predecessor, an SpO2 sensor for blood oxygen monitoring, and an all-new Exynos chipset built on a 5nm process. As announced at Google I/O 2021 last month, both the Galaxy Watch 4 and Galaxy Watch 4 Active will be running the unified "new" Wear OS platform co-developed by Samsung and Google.',how_popular:120},C.bt,t.EU)
