C.yr=new H.aO(7,{title:"Leaked memo confirms OnePlus will become an Oppo sub-brand",source:"The Verge - All Posts",article_url:"https://www.theverge.com/2021/6/21/22543184/oppo-oneplus-merger-brand-pete-lau-bbk-memo",image_url:"https://cdn.vox-cdn.com/thumbor/eazb8F1EOXEhg_jl4VVlp5HArkE=/0x0:2040x1360/1310x873/cdn.vox-cdn.com/uploads/chorus_image/image/69480030/bfarsace_4481_20210317_0073_Edit.0.jpg",date:1624292746,news_text:"Last week OnePlus CEO Pete Lau said in a forum post that the company will \u201cfurther integrate\u201d with Oppo, but didn\u2019t elaborate on how that\u2019d work in practise. Now, leaker Evan Blass has obtained a document that serves as a talking points memo for use by OnePlus PR, and it explains the integration in plainer terms. \u201cWith the integration, OnePlus becomes a brand within Oppo, however will continue to function as an independent entity,\u201d reads the most pertinent answer. The memo also says that Lau\u2019s role as chief product officer at Oppo will make him responsible for the product strategies of both Oppo and OnePlus.This isn\u2019t particularly surprising. Here\u2019s what I wrote last week following Lau\u2019s post",how_popular:99},C.bt,t.EU)
C.yk=new H.aO(7,{title:"The Motorola Moto G Stylus 5G is a good phone with a too-short shelf life",source:"The Verge - All Posts",article_url:"https://www.theverge.com/22538663/motorola-moto-g-stylus-5g-review-specs-screen-price",image_url:"https://cdn.vox-cdn.com/thumbor/8PmaZ7IVeVIUrT4Uzt6neZs9P1w=/0x167:2000x1167/fit-in/1200x600/cdn.vox-cdn.com/uploads/chorus_asset/file/22668422/DSC00875.jpg",date:1624286762,news_text:"TheThe Motorola Moto G Stylus 5G, as you may have pieced together, is a phone with a built-in stylus and 5G. It\u2019s a slightly upgraded version of the 4G-only, 2021-edition Moto G Stylus (I\u2019m sorry, that\u2019s really how these phones are named). The Stylus 5G includes a few more hardware upgrades in addition to 5G connectivity, including a bigger battery, more storage and RAM (256GB and 6GB on the version I tested, respectively), and a newer Snapdragon 480 processor. There\u2019s a new stylus-friendly GIF creator mode, which is fun. Fun is good! But it more or less feels like the same phone: the rear camera array is identical with the exception of a different macro sensor, its 6.8-inch screen is the same, and overall dimensions are similar.",how_popular:25},C.bt,t.EU)
C.yl=new H.aO(7,{title:"Super Mario World receives the widescreen emulation mod it deserves",source:"The Verge - All Posts",article_url:"https://www.theverge.com/tldr/2021/6/21/22543305/super-mario-world-widescreen-rom-hack-bsnes-hd",image_url:"https://cdn.vox-cdn.com/thumbor/gogV2vvznhUe-uG7dPG5zSbK5ko=/0x0:2560x1440/920x613/filters:focal(1076x516:1484x924):format(webp)/cdn.vox-cdn.com/uploads/chorus_image/image/69480489/msedge_ZDHAPTUK8C.0.jpg",date:1624296971,news_text:"Some purists might sneer at the idea of playing retro games in anything other than their original 4:3 aspect ratio. But for anyone else, a new widescreen hack for Super Mario World means you can now enjoy the 1990 game on modern displays, without having to put up with black bars or a weirdly stretched image. Super Mario World Widescreen is the work of ROM hacker Vitor Vilela, and works by modifying the original game\u2019s ROM when played through the bsnes_hd emulator. It means the game\u2019s original 256x224 internal screen size can be adjusted to 352\xd7224 to give it the correct aspect ratio for a 16:9 display. As well as 16:9, the patch also supports 16:10 resolutions, and ultrawide 21:9 support is planned for the future.",how_popular:300},C.bt,t.EU)
